package sheet.com;

public class Shee {
 private Integer id;
 private String name;
public Shee() {
	super();
	// TODO Auto-generated constructor stub
}
public Integer getId() {
	return id;
}
public void setId(Integer id) {
	this.id = id;
}
public String getName() {
	return name;
}
public void setName(String name) {
	this.name = name;
}
@Override
public String toString() {
	return "Shee [id=" + id + ", name=" + name + "]";
}
}
